import React, { Component } from 'react';

import '../../App.css';

import heartOn from '../../Assets/heart-on.png';
import heartOff from '../../Assets/heart-off.png';

import starOn from '../../Assets/star-on.png';
import starOff from '../../Assets/star-off.png';

class Summary extends Component {
  render() {
    return (
      <div className="Summary">
        <div className="Summary-Overlay-Box">
          <div className="Summary-Header">
            <img src={starOn} className="Summary-Icon" id="Summary-L" alt="heart icon" />  
            <img src={starOn} className="Summary-Icon" id="Summary-M" alt="heart icon" />  
            <img src={starOn} className="Summary-Icon" id="Summary-R" alt="heart icon" />  
          </div>
          <h4>Month</h4>
          <h1>0</h1>
          <h3>Complete!</h3>
          <p className="Summary-Text">{this.props.summary}</p>
          <div>
            <button className="Summary-button" id="Retry">Retry</button> 
            <button className="Summary-button" id="Continue">Continue</button>
          </div>
        </div>
      </div>
    );
  }
}

export default Summary;
